import React from 'react'
import dh_logo from '../images/DH.png';
import dentistImage from '../images/doctor.jpg';
import facebook from '../images/ico-facebook.png';
import tiktok from '../images/ico-tiktok.png';
import whatsapp from '../images/ico-whatsapp.png';
import Instagram from '../images/ico-instagram.png';


const Footer = () => {
  return (
    <footer className='fo_display'>
        <div className='fo_display'>
          <p>Powered by</p>
          <img src={dh_logo} alt='DH-logo' />
        </div>
        <div className='fo_display'>

        
        <svg class="icono" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">
         <path d="M12 2C6.48 2 2 6.48 2 12C2 16.42 5.14 20.13 9.33 21.54V14.59H6.75V12H9.33V9.77C9.33 7.08 10.92 5.25 13.38 5.25C14.61 5.25 15.75 5.89 16.22 6.61V4.81H18.75V3H16.22V2.89C16.22 2.89 14.78 2 12 2Z" />
        </svg>

          

        </div>

    </footer>
  )
}

export default Footer
